You can use JavaScript's built-in `Object.keys()` method along with `Array.prototype.sort()` to sort keys of an object and then print their corresponding values. Here is how you could do it:

```javascript
var dict = { "b": 2, "a": 1, "c": 3 }; // your dictionary

// Get the sorted keys
let keysSorted = Object.keys(dict).sort();

for (const key of keysSorted) {
    console.log("Key: ", key);
    console.log("Value: ", dict[key]);
}
```
In this code, `Object.keys()` returns an array with all the keys in your dictionary. Then we use `Array.prototype.sort()` to sort these keys alphabetically. Finally, we loop through each key and print its corresponding value from our dictionary. 

Please replace "dict" with your actual object name.
